import './App.css';
import Home from './Components/Home';
import OurDetail from './Components/OurDetail';
import Partner from './Components/Partner';
function App() {
  return (
    <div>
      <navbar className="nav-link">
        <div className='logo'><h3><i class="bi bi-window-dock"></i><span className='logo-head'> V-Meet</span></h3></div>
        <div>
          <ul className='ul-link'>
            <li>Home</li>
            <li>Meeting</li>
            <li>Add Meeting</li>
          </ul>
        </div>
      </navbar>
      <Home/>
      <OurDetail/>
      <Partner/>
    </div>
  );
}

export default App;
